import React from 'react';
import "./members.css"
import {Member} from "../Data/members"
import Flag  from "../../images/flag.png"

const Members = ()=>{
    return(
        <div className='memberCards'>
            {Member.map((members) => {
                return (
                    <div className='members'>
                        <div>
                            <img src={Flag} alt="" />
                            <img src={members.image} alt="" className='' />
                        </div>
                        <div>
                            {members.names}
                            {members.place}
                        </div>

                    </div>
                )
            })}
        </div>

    )
}
export default Members
